import React from 'react';
import { cpus } from 'os';

const Card = (props) => {
    const cWidth = 485;
    const cHeight = 300;
    const cPadding = 10;
    const cHeadFoot = 0.1;

    return (
        <div class="col-sm-4">
            <div class="card shadow-sm mb-3">
                <h5 class="card-header text-center bg-primary">
                    Card Title
            </h5>
                <div class="card-body overflow-auto">
                    <p class="card-text">this is some text within a card body.</p>
                </div>
                <div class="card-footer text-muted">
                    Card Footer
            </div>
            </div>
        </div>
    )
}

export default Card;
